import styled from "styled-components";


export const Tbody = styled.tbody`
    height: 500px;
    overflow-y: scroll;
    cursor:pointer;
`

export const NewDiv = styled.div`
    @media(max-width: 767px){
    display:flex;
    width:100%;
    justify-content:center;
    align-items:center;
    font-size:10px;
`
